-- Import July 2025 Sales Data
-- Total invoices: 216



-- Verification Query
SELECT 
    COUNT(*) as total_july_sales,
    SUM(total_amount) as total_july_amount,
    SUM(shipping) as total_july_shipping,
    SUM(total_amount + shipping) as grand_total
FROM sales 
WHERE date >= '2025-07-01' AND date <= '2025-07-31';
